import React from "react";
import { useState, useEffect } from "react";
import { Link, useHistory } from  'react-router-dom';
// import { useDispatch, useSelector } from "react-redux";
// import { postPokemon } from '../Redux/Actions/Actions';
//import './Creacion.css';


function Creacion(){
    // const dispatch = useDispatch();
    
    const [input, setInput ] = useState({
        name:"",
        types: "",
        hp: 0,
        attack: "",
        defense: "",
        speed: "",
        height: 0,
        wight: 0,
        image: ""
    })
    
    // inicializacion de rangos input "range":
    const [rangoHp, setRangoHp] = useState(0);
    const [rangoAttack, setRangoAttack] = useState(0);
    const [rangoDefense, setRangoDefense] = useState(0);
    const [rangoSpeed, setRangoSpeed] = useState(0);
    const [rangoHeight, setRangoHeight] = useState(0);
    const [rangoWight, setRangoWight] = useState(0);


    function handleChange(e){
        setInput({
            ...input,
            [e.target.name]: e.target.value
        })
    }

    function handleSubmit(e){
        e.preventDefault();
        // setInput({...input.name=input.name.toLowerCase()});
        // dispatch(postPokemon(input));
        alert('personaje creado');
        setInput({
            name:"",
            types: "",
            hp: 0,
            attack: "",
            defense: "",
            speed: "",
            height: 0,
            wight: 0
        })
        //useHistory.push('/home');
    }

    // let validateName = /^[a-zA-Z\s]+$/;
    // let validateUrl = /(http(s?):)([/|.|\w|\s|-])*.(?:jpg|gif|png)/;

    // useEffect(() => {
    //     dispatch(postPokemon())
    // })

    return (
        <>
        <Link to='./home' ><button className="botonSubmit">volver</button></Link>
        <h1 className="tituloCreacion">Crea tu personage</h1>
        <form 
            onSubmit={(e)=>handleSubmit(e)}
        >
            <div>
                <div>
                    <label>Nombre:</label>
                    <input 
                        className="field"
                        type='text'
                        value={input.name}
                        name='name'
                        onChange={handleChange}
                    />
                </div>
            
                <div>
                    <label>Imagen:</label>
                    <input 
                        className="field"
                        type='text'
                        value={input.image}
                        name='image'
                        onChange={handleChange}
                    />
                </div>
            </div>


            <div>
                <div>
                    <label>Altura: {rangoHp}</label>
                    <input 
                        className="field"
                        type='range'
                        value={input.hp}
                        name='hp'
                        onInput={(e) => setRangoHp(e.target.value)}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Peso: {rangoAttack}</label>
                    <input 
                        className="field"
                        type='range'
                        value={input.attack}
                        name='attack'
                        onInput={(e) => setRangoAttack(e.target.value)}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Año: {rangoDefense}</label>
                    <input
                        className="field"
                        type='range'
                        value={input.defense}
                        name='defense'
                        onInput={(e) => setRangoDefense(e.target.value)}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Temperamento: {rangoDefense}</label>
                    <select
                        className="field"
                        type='text'
                        value={input.defense}
                        name='defense'
                        onInput={(e) => setRangoDefense(e.target.value)}
                        onChange={handleChange}
                    />
                </div>
                {/* // [ ] Botón/Opción para crear una nueva raza de perro -> STRING? */}
                <div>
                    <label>Raza de perro: {rangoDefense}</label>
                    <input
                        className="field"
                        type='text'
                        value={input.defense}
                        name='defense'
                        onInput={(e) => setRangoDefense(e.target.value)}
                        onChange={handleChange}
                    />
                </div>
                
                
                <button className="botonSubmit" type="submit">Crear Personaje</button>
            </div>

        </form>
        </>
    )
}

export default Creacion;





